import React from "react";

import styles from "../CSS/component.module.css";

export const Estimator_Top_Row = () => {
  return (
    <div className={styles.outer_top_row}>
      <div className={styles.inner_top_row}>
        <p>이름</p>
        <p>타입</p>
        <p>제출자</p>
        <p>회차</p>
      </div>
    </div>
  );
};
